function create_new_Pdf(max_hight, used_hight, doc) {
  if (used_hight >= (max_hight - 30)) {
    doc.addPage("a4", "portrait");
    console.log("New PDF creaetd");

    return true;
  } else {
    console.log("Not Created");
    return false;
  }

}

function reset_y_value(result, currnet_y) {
  if (result == true) {
    currnet_y = 0;
    return currnet_y;
  } else {
    return currnet_y;
  }
}

function addWrappedText(text, textWidth, doc, fontSize, fontType = 'normal', lineSpacing, xPosition, initialYPosition, pageWrapInitialYPosition) {
  doc.setFontType(fontType);
  doc.setFontSize(fontSize);
  var textLines = doc.splitTextToSize(text, textWidth); // Split the text into lines
  var pageHeight = doc.internal.pageSize.height;        // Get page height, we'll use this for auto-paging. TRANSLATE this line if using units other than `pt`
  var cursorY = initialYPosition;

  textLines.forEach(lineText => {
    if (cursorY > pageHeight - 20) { // Auto-paging
      doc.addPage("a4", "portrait");
      cursorY = pageWrapInitialYPosition;
    }
    doc.text(xPosition, cursorY, lineText);
    cursorY += lineSpacing;
  })

  return cursorY;
}

